INSERT INTO `cvh_baiviet` (`id`, `title`, `content`, `if_admin`, `views`, `likes`, `comments`, `status`, `role`, `poster`, `created`, `time`) VALUES
(17, 'Chào mừng đến với Ngọc Rồng Online', '<h5 data-start=\"204\" data-end=\"373\"><span style=\"font-family: \'comic sans ms\', sans-serif;\">Xin ch&agrave;o c&aacute;c chiến binh , ch&agrave;o mừng bạn đ&atilde; đến với&nbsp;<strong data-start=\"257\" data-end=\"283\">Ngọc Rồng Online (NRO)</strong> &ndash; tựa game nhập vai đặc sắc lấy cảm hứng từ bộ truyện huyền thoại <strong data-start=\"350\" data-end=\"370\">7 Vi&ecirc;n Ngọc Rồng</strong>.</span></h5>\r\n<h5 data-start=\"375\" data-end=\"575\"><span style=\"font-family: \'comic sans ms\', sans-serif;\">Trong game, bạn sẽ được h&oacute;a th&acirc;n th&agrave;nh những nh&acirc;n vật quen thuộc như <strong data-start=\"444\" data-end=\"475\">Songoku, Vegeta, Piccolo...</strong> c&ugrave;ng tham gia h&agrave;nh tr&igrave;nh luyện tập, săn boss, vượt ải v&agrave; thu thập <strong data-start=\"542\" data-end=\"555\">ngọc rồng</strong> để tăng sức mạnh.</span></h5>\r\n<h5 data-start=\"577\" data-end=\"618\"><span style=\"font-family: \'comic sans ms\', sans-serif;\">Điểm đặc biệt của <strong data-start=\"595\" data-end=\"615\">Ngọc Rồng Online</strong>:</span></h5>\r\n<ul data-start=\"619\" data-end=\"895\">\r\n<li style=\"font-family: \'comic sans ms\', sans-serif;\" data-start=\"619\" data-end=\"681\">\r\n<h5 data-start=\"621\" data-end=\"681\"><span style=\"font-family: \'comic sans ms\', sans-serif;\"><strong>&nbsp;Lối chơi đa dạng:</strong> train qu&aacute;i, săn đồ, tham gia sự kiện.</span></h5>\r\n</li>\r\n<li style=\"font-family: \'comic sans ms\', sans-serif;\" data-start=\"682\" data-end=\"758\">\r\n<h5 data-start=\"684\" data-end=\"758\"><span style=\"font-family: \'comic sans ms\', sans-serif;\"><strong>Thế giới rộng lớn:</strong> nhiều map, nhiều h&agrave;nh tinh kh&aacute;c nhau để kh&aacute;m ph&aacute;.</span></h5>\r\n</li>\r\n<li style=\"font-family: \'comic sans ms\', sans-serif;\" data-start=\"759\" data-end=\"845\">\r\n<h5 data-start=\"761\" data-end=\"845\"><span style=\"font-family: \'comic sans ms\', sans-serif;\"><strong>Cộng đồng đ&ocirc;ng đảo:</strong> người chơi c&oacute; thể lập bang hội, giao lưu v&agrave; PK cực hấp dẫn.</span></h5>\r\n</li>\r\n<li style=\"font-family: \'comic sans ms\', sans-serif;\" data-start=\"846\" data-end=\"895\">\r\n<h5 data-start=\"848\" data-end=\"895\"><span style=\"font-family: \'comic sans ms\', sans-serif;\"><strong>Cơ hội nhận v&agrave;ng, ngọc, trang bị qu&yacute; hiếm</strong>.</span></h5>\r\n</li>\r\n</ul>\r\n<h5 data-start=\"897\" data-end=\"1082\"><span style=\"font-family: \'comic sans ms\', sans-serif;\">&nbsp;Đ&acirc;y l&agrave; nơi để c&aacute;c bạn giải tr&iacute;, c&ugrave;ng nhau trải nghiệm tuổi thơ gắn liền với bộ truyện Dragon Ball. H&atilde;y bắt đầu chuyến h&agrave;nh tr&igrave;nh ngay h&ocirc;m nay v&agrave; trở th&agrave;nh chiến binh mạnh nhất nh&eacute;</span></h5>', '{\"name\":\"ADMIN\",\"avatar\":\"\\/assets\\/images\\/avatar\\/admin\\/10.png\"}', '44', '[\"admin\",\"tdzai03\"]', '[]', 1, 2, '2', '2025-09-24', '1758725064');
