INSERT INTO `posts` (`id`, `tieude`, `noidung`, `username`, `created_at`, `theloai`, `ghimbai`, `image`, `trangthai`, `tinhtrang`, `like`) VALUES
(5, 'Chuỗi Sự Kiện Tháng 5', '📣[Sự Kiện] - CHUỖI NHIỆM VỤ THÁNG 5 📣\nChào các cư dân,\nAdmin sẽ tiến hành bảo trì để cập nhật nội dung sự kiện: CHUỖI NHIỆM VỤ THÁNG 5.\n⏰Thời gian diễn ra sự kiện: đến 23h59 31/05/2025.\n\nNội dung của sự kiện như sau:\n🛎Sử dụng càng nhiều vật phẩm sự kiện - tỉ lệ ra vật phẩm vĩnh viễn càng cao.\n🔥1/ X3 THẺ NẠP - TIỀM NĂNG SỨC MẠNH\n- Từ 00h05 ngày 30/04 đến hết ngày 01/05\n\n🔥2/ CHUỖI NHIỆM VỤ THÁNG 5\n- Các cư dân đến Quy Lão để làm nhiệm vụ tháng 5\n- Nhiệm vụ sẽ chia ra 2 loại thường và VIP \n🔥3/ ĐỔI ĐIỂM TẠI QUY LÃO\nNgười chơi có thể đổi các vật phẩm có hạn sử dụng hoặc nếu may mắn sẽ nhận được vĩnh viễn tại NPC Quy Lão tại Đảo Kame.\nThời gian từ ngày đến hết 11/05\n\n🔥4/ ĐUA TOP PHÁO HOA\nPháo hoa vip và Pháo Hoa Thường được bán tại Chi Chi.\nThời gian Đua Top xem tạo Chi Chi\nĐủ 10 điểm sẽ được vào top\nA. ĐUA TOP PHÁO HOA VIP\n✨Top 1: Máy Bay Chiến Đấu vĩnh viễn + Sách Cũ x70 + Capsule 1 món kích hoạt x3 + Hematite x20 + Capsule vỡ x1\n✨Top 2: Máy Bay Chiến Đấu vĩnh viễn + Sách Cũ x60 + Capsule 1 món kích hoạt x2 + Hematite x15\n✨Top 3: Máy Bay Chiến Đấu vĩnh viễn + Sách Cũ x50 + Capsule 1 món kích hoạt x1 + Hematite x10\n✨Top 4-10: Máy Bay Chiến Đấu 180 ngày + Sách Cũ x20 + Phiếu đổi Capsule x 50 + Hematite x5\n✨Top 11-50: Máy Bay Chiến Đấu 90 ngày + Sách Cũ x10 + Phiếu đổi Capsule x 20 + Hematite x5\n✨Top 51 - 100: Máy Bay Chiến Đấu 60 ngày + Sách Cũ x5 + Phiếu đổi Capsule x 10 + Hematite x5\n\nB. ĐUA TOP PHÁO HOA\n✨Top 1: Máy Bay Chiến Đấu Xám vĩnh viễn + Đá Bảo Vệ x50 + Capsule 1 món kích hoạt x3 + Capsule vỡ x1\n✨Top 2: Máy Bay Chiến Đấu Xám vĩnh viễn + Đá Bảo Vệ x40 + Capsule 1 món kích hoạt x2\n✨Top 3: Máy Bay Chiến Đấu Xám vĩnh viễn + Đá Bảo Vệ x30 + Capsule 1 món kích hoạt x1\n✨Top 4-10: Máy Bay Chiến Đấu Xám 180 ngày + Đá Bảo Vệ x20 + Phiếu đổi Capsule x50\n✨Top 1-50: Máy Bay Chiến Đấu Xám 90 ngày + Đá Bảo Vệ x10 + Phiếu đổi Capsule x20\n✨Top 51-100: Máy Bay Chiến Đấu Xám 60 ngày + Đá Bảo Vệ x5 + Phiếu đổi Capsule x10\n+ Tăng tỉ lệ rớt đồ thần linh từ Boss cấp 1 đến cấp 3\n\nChúc Các Cư Dân Online Vui Vẻ ❤', 'admin', '2025-05-05 15:02:22', 0, 1, '[\"sukienthang5.jpg\"]', 0, 0, 0),
(6, 'Sự kiện Giỗ tổ Hùng Vương 2025', 'Chào các cư dân,\nAdmin sẽ tiến hành bảo trì để cập nhật nội dung sự kiện: GIỖ TỔ HÙNG VƯƠNG 2025.\n- Thời gian diễn ra sự kiện: từ 04/04/2025 đến 23h59 04/05/2025.\nNội dung của sự kiện như sau:\nSử dụng càng nhiều vật phẩm sự kiện - tỷ lệ ra vật phẩm vĩnh viễn càng cao.\n〓1/ X3 THẺ NẠP - TIỀM NĂNG SỨC MẠNH〓\n- Từ 00h05 ngày 05/04 đến hết ngày 07/04\n〓2/ ĐỔI ĐIỂM TẠI NPC QUY LÃO〓\nNgười chơi có thể đổi các vật phẩm có hạn sử dụng hoặc nếu may mắn sẽ nhận được vĩnh viễn tại NPC Quy Lão tại Đảo Kame.\nThời gian từ ngày 04/04 đến hết 11/04\nTrong thời gian diễn ra sự kiện, cư dân đổi Trứng Vàng Rồng Nhí sẽ nhận được 1 điểm đua top.\nThời gian xem chi tiết tại NPC Chi Chi\nQuà Top:\n- Top 1: Ván bay Rồng Thiêng VIP vĩnh viễn + Sách Cũ x70 + Capsule 1 món kích hoạt x3 + Capsule vỡ x3\n- Top 2: Ván bay Rồng Thiêng vĩnh viễn + Sách Cũ x60 + Capsule 1 món kích hoạt x2 + Capsule vỡ x2\n- Top 3: Ván bay Rồng Thiêng vĩnh viễn + Sách Cũ x50 + Capsule 1 món kích hoạt x1 + Capsule vỡ x1\n- Top 4-10: Ván bay Rồng Thiêng 180 ngày + Sách Cũ x20 + Phiếu đổi Capsule x50 - Top 11-50: Ván bay Rồng Thiêng 90 ngày + Sách Cũ x10 + Phiếu đổi Capsule x20 - Top 51 - 100: Ván bay Rồng Thiêng 60 ngày + Sách Cũ x5 + Phiếu đổi Capsule x10\nCư dân hãy đến Quy Lão để nhận một trong những vật phẩm sau:\n- 1 Giáo Thủy Tinh 3 ngày\n- 1 Rìu Sơn Tinh 3 ngày\n- Hắc Mị Nương 3 ngày\n〓4/ TRỒNG DƯA〓\n- Trong 15 ngày đầu diễn ra sự kiện (từ 04/04/2025 đến hết 18/04/2025), các cư dân hãy đi tìm Vua Hùng để nhận cây dưa hấu nhé. Mỗi ngày cây dưa hấu sẽ ra 10 trái.\n- Tích dưa hấu sau đó dùng thêm tem chứng nhận (bán tại Chi Chi) và đi tìm Vua hùng tại làng Aru để đổi lấy những viên hồng ngọc nhé.\n*Lưu ý: từ ngày 20/04/2025 Hùng Vương sẽ không cho dưa hấu nữa, cư dân chỉ còn đổi quà từ dưa hấu thôi nhé.\n* Phần Quà :\n+ 1 quả dưa + 1 tem Nhận 5 thỏi vàng\n+ 10 quả dưa + 2 tem Nhận 40 thỏi vàng\n+ 20 quả dưa + 3 tem Nhận 120 thỏi vàng\n+ 25 quả dưa + 4 tem Nhận 185 thỏi vàng\n+ 30 quả dưa + 5 tem Nhận 250 thỏi vàng\n〓6/ DÂNG SÍNH LỄ CHO VUA HÙNG〓\nTrong thời gian xảy ra sự kiện sẽ xuất hiện 3 quái vật truyền thuyết tại các map ngẫu nhiên\nNgoài ra còn có thể mua mảnh bản đồ truyền thuyết tại Chi Chi để đi vào.\nCác cư dân hãy hạ gục bọn chúng và nhặt tín vật để chứng minh các cư dân là dũng sĩ.\n- Ngà voi (Ký gửi ngọc)\n- Hồng mao (Ký gửi Vàng)/ (Ký gửi ngọc dành cho Super1 - Super2 )\n- Cựa gà (Ký gửi Vàng)/ (Ký gửi ngọc dành cho Super1 - Super2)\nSau khi thu thập đầy đủ nguyên liệu, hãy đến Vua Hùng để ghép hộp quà:\n* Hộp Quà Thường Giỗ Tổ 2025\n9 Ngà voi + 9 Hồng mao + 9 Cựa gà + 1.000.000 Vàng\n* Hộp Quà Cao Cấp Giỗ Tổ 2025\n9 Ngà voi + 9 Hồng mao + 9 Cựa gà + 10 ngọc (ngọc bất kỳ)\n*Phần thưởng khi sử dụng Hộp Quà Thường Giổ Tổ 2025:\n+ Giáo Thủy Tinh hạn sử dụng và vĩnh viễn\n+ Rìu Sơn Tinh hạn sử dụng và vĩnh viễn\n+ Và các phẩm khác\n*Phần thưởng khi sử dụng Hộp Quà Cao Cấp Giổ Tổ 2025:\n+ Vua Vegeta hạn sử dụng và vĩnh viễn\n+ Giáo Thủy Tinh hạn sử dụng và vĩnh viễn\n+ Rìu Sơn Tinh hạn sử dụng và vĩnh viễn\n+ Cải Trang Hắc Mị Nương hạn sử dụng và vĩnh viễn\n+ Và các phẩm khác\n**Đua top sử dụng Hộp Quà Cao Cấp Giổ Tổ 2025**\n+ Thời gian xem tại Chi Chi\n+ Điều kiện vào top phải trên 15 điểm\n*Phần thưởng đua top bao gồm:\n- Top 1: Ra Đa Ngọc Rồng Vip 100 + Đá bảo vệ x 60 + Capsule 1 món kích hoạt x3 + capsule vỡ x1\n- Top 2: Ra Đa Ngọc Rồng Vip 50 + Đá bảo vệ x 40 + Capsule 1 món kích hoạt x2 - Top 3: Ra Đa Ngọc Rồng Vip 30 + Đá bảo vệ x 30 + Capsule 1 món kích hoạt x1 - Top 4-10: Ra Đa Ngọc Rồng Vip 20 + Đá bảo vệ x 20 + Phiếu đổi capsule x50 - Top 11-50: Ra Đa Ngọc Rồng Vip 10 + Đá bảo vệ x 10 + Phiếu đổi capsule x20 - Top 51-100: Ra Đa Ngọc Rồng Vip 5 + Đá bảo vệ x 5 + Phiếu đổi capsule x10 \n〓7/ DÂNG BÁNH CHO VUA HÙNG〓\n- Đánh quái rơi Nếp - max 999/ngày (Ký gửi Vàng, Không thể giao dịch)/ (Ký gửi ngọc  capsule x10 \n〓8/ CẬP NHẬT SHOP CHI CHI〓\nMở Bán\n- Cải trang Sơn Tinh, Thủy Tinh mới\n- Và các vật phẩm trong sự kiện\n〓10/ ĐI TÌM RỒNG NHÍ〓\n+ Trong thời gian diễn ra sự kiện Rồng Nhỉ sẽ xuất hiện ngẫu nhiên trong các map\n+ Hạ Rồng Nhí sẽ có cơ hội được mảnh trứng rồng nhí ngẫu nhiên\n+ Khi cư dân đủ 99 mảnh trứng rồng sẽ dụng để nhận được 1 trứng rồng nhí + Nếu may mắn sẽ nhận khi đổi mảnh trứng rồng sẽ nhận được Trứng Vàng\n〓12/ SƠN - THỦY PHÂN TRANH 〓\n- Trong thời gian diễn ra sự kiện, Boss Sơn Tinh và Thủy Tinh sẽ xuất hiện ngẫu nhiên khắp nơi, khi gặp Sơn Tinh - Thủy Tinh hãy chọn cờ theo bên mà bạn muốn giúp, hạ đối thủ cờ kia và nhặt lấy cải trang nhé.\n- Ngoài ra có rớt 2 cờ mới hạn sử dụng\n+ Giáo Thủy Tinh new + Rìu Sơn Tinh new\n〓13/ ƯỚC RỒNG CẬP NHẬT SAU ....〓 \nLưu Ý: Các vật phẩm sự kiện sẽ bị thu hồi sau 30 ngày kết thúc sự kiện\nChúc Các Cư Dân Vui Vẻ', 'admin', '2025-05-05 15:40:40', 0, 1, '[\"sukienvuahung.jpg\"]', 0, 0, 0),
(7, 'Sự Kiện Goku Day', 'Chào các Cư Dân, Chắc các Fan cũng biết ngày mai là ngày 09/05 được gọi là Ngày Goku (Goku Day), vì vậy Admin sẽ tiến hành bảo trì toàn bộ máy chủ để cập nhật cho sự kiện lần này.\nNội dung sự kiện như sau: \n🕛 Thời Gian sự kiện bắt đầu từ bảo trì đến hết ngày 31/05/2025 \n💝1. Săn Boss Nhận Box \nCác cư dân sẽ săn các Boss dưới đây để có thể nhận hộp quà Goku Day \n+ Ăn Trộm: 1 Hộp Goku day/ngày \n+ Virut: 1 Hộp Goku day/ngày \n+ Ở Dơ: 1 Hộp Goku day/ngày \n+ Sói Héc Quyn: 1 Hộp Goku day/ngày \n+ Black Goku: 5 Hộp Goku day/ngày \n💝2. Hóa Thân Thành Goku Săn Pet Thỏ\nTrong thời gian sự kiện khi mặc cải trang Goku bất kì, người chơi tiến hành đánh quái sẽ có cơ hội nhận được Thỏ Vui Vẻ vĩnh viễn (Trang bị Pet)\nLưu ý: \n+ Dùng các cải trang (Goku, Goku SSJ1, Goku SSJ2, Goku SSJ3, Goku SSJ4 Red, Goku God, Goku Blue). \n+ Dùng tự động luyện tập để có cơ hội rớt thỏ cao hơn \n+ Dùng Cải Trang Goku SSJ4 - Red có tỉ lệ rớt thỏ cao nhất \n+ Dùng cải trang Goku chỉ áp dụng cho bản thân (không tính đệ)\n💝3. Làm Nhiệm Vụ Nhận Quà\nMỗi ngày làm nhiệm vụ tại Bò Mộng sẽ nhận được các hộp quà \n+ Dễ: 1 Hộp Goku day \n+ Khó: 2 Hộp Goku day \n+ Siêu Khó: 1 Hộp Goku day Vip \n💝4. Cửa Hàng Tại Chi Chi\nCửa hàng sẽ mở bán các Hộp Goku Day và Goku SSJ4 \n💝5. Đổi Quà Tại Quy Lão\n- Người chơi có thể đổi các vật phẩm có hạn sử dụng hoặc nếu may mắn sẽ nhận được vĩnh viễn tại NPC Quy Lão tại Đảo Kame. \n- Thời Gian nhận điểm đổi sự kiện đến hết ngày 15/05, sau đó shop chỉ mở để có thể đổi điểm còn dư\n💝6. Khuyễn mãi x3 Thẻ Nạp và Exp \n- Từ 00h05 ngày 09/05 đến hết ngày 10/05/2025, x3 giá trị nạp ngọc áp dụng với tất cả phương thức thanh toán hiện có và đồng thời x3 tiềm năng sức mạnh trong thời gian trên\n💝7. Đua Top Đổi Hộp Qua Goku Day Vip 2025 \nThời gian Đua Top xem tại NPC Chi Chi ở Đảo Kame\nĐủ 10 điểm sẽ được vào top Hộp Quà Goku Day Vip 2025 đổi tại Quy Lão \n✨Top 1: Ra Đa Ngọc Rồng Vip 100 + 20 mảnh Khỉ + Sách Cũ x70 + Capsule 1 món kích hoạt x3 + capsule vỡ x3\n✨Top 2: Ra Đa Ngọc Rồng Vip 50 + 10 mảnh Khỉ + Sách Cũ x60 + Capsule 1 món kích hoạt x2 + capsule vỡ x2\n✨Top 3: Ra Đa Ngọc Rồng Vip 30 + 5 mảnh Khỉ + Sách Cũ x50 + Capsule 1 món kích hoạt x1 + capsule vỡ x1\n✨Top 4-10: Ra Đa Ngọc Rồng Vip 20 + 2 mảnh Khỉ + Sách Cũ x20 + Phiếu đổi capsule x50\n✨Top 11-50: Ra Đa Ngọc Rồng Vip 10 + Sách Cũ x10 + Phiếu đổi capsule x20\n✨Top 51-100: Ra Đa Ngọc Rồng Vip 5 + Sách Cũ x5 + Phiếu đổi capsule x10\n\nGoku no Hi <3', 'admin', '2025-05-09 04:36:50', 0, 1, '[\"sukiengoku.jpg\"]', 0, 0, 0),
(63, 'TÍNH NĂNG MỚI: ĐỆ TỬ MỚI', 'Chào các cư dân\r\nAdmin sẽ bảo trì để cập nhật nội dung Đệ Tử Mới\r\nNội dung như sau:\r\n🌟 GIỚI THIỆU 3 ĐỆ TỬ MỚI\r\nNgười chơi nay có thể sở hữu 1 trong 3 Đệ tử mới cực chất, được lấy cảm hứng từ những chiến binh huyền thoại:\r\nUbu (Hệ Trái Đất): Kế thừa sức mạnh và ý chí từ Bư, chiến đấu linh hoạt, thể lực cao.\r\nKid Jiren (Hệ Namek): Phiên bản thuở nhỏ của chiến binh công lý Jiren, sở hữu năng lực phòng thủ và sức mạnh vượt trội.\r\nKid Beer (Hệ Xayda): Hình dáng nhỏ nhưng sức mạnh hủy diệt, tiềm năng chiến đấu khủng khiếp từ nhỏ.\r\n🧪ĐIỀU KIỆN ĐỔI ĐỆ TỬ MỚI\r\nĐể có thể đổi được đệ tử trên, người chơi cần đáp ứng đủ các điều kiện sau:\r\nĐã sở hữu đệ tử Mabu hoặc trứng Bư đã nở.\r\nĐệ tử hiện tại phải đạt từ 40 tỷ sức mạnh trở lên.\r\nPhải có Bình Hút Năng Lượng Bư.\r\n🎯 CÁCH NHẬN BÌNH HÚT NĂNG LƯỢNG BƯ\r\nBình Hút Năng Lượng sẽ được nhận ngẫu nhiên sau khi đánh bại Boss Hirudegarn.\r\nLưu ý: Chỉ khi có đủ các điều kiện nêu trên (trứng Bư đã nở hoặc đệ Ma Bư + đệ trên 40 tỷ) mới có cơ hội nhận bình sau khi đánh boss.\r\n🗺 HƯỚNG DẪN ĐỔI ĐỆ TỬ MỚI\r\nKhi đã có Bình Hút Năng Lượng, hãy di chuyển đến bản đồ Đại Hội Võ Thuật.\r\nTìm gặp NPC Ôsin – đây là người sẽ giúp bạn vào map hút năng lượng.\r\nTrong map đặc biệt này, bạn cần hút đủ 3000 Kilis.\r\nSau khi hút đủ, bạn có thể dùng đệ hiện tại trên 40 tỷ để đổi sang 1 trong 3 đệ mới (Ubu, Kid Jiren hoặc Kid Beer).\r\n⚠️ LƯU Ý QUAN TRỌNG\r\nMột khi đổi đệ, đệ hiện tại sẽ bị thay thế – hãy cân nhắc kỹ trước khi quyết định.\r\nMỗi nhân vật chỉ có thể sở hữu 1 đệ tử mới tại một thời điểm.\r\nHãy sẵn sàng cho hành trình mới cùng Ubu, Kid Jiren và Kid Beer – những người bạn đồng hành mạnh mẽ trên con đường chinh phục vũ trụ nhé! 🚀', 'admin', '2025-05-22 16:16:15', 0, 1, '[\"detu.png\"]', 0, 0, 0),
