(89, 'SỰ KIỆN HÈ 1 – ẨM THỰC MÙA HÈ', 'Chào Các Cư Dân,\r\nMùa hè đã đến, cùng tham gia tiệc ẩm thực mùa hè cùng Goten nhé!\r\nChi tiết sự kiện như sau : Thời gian diễn ra sự kiện từ 07/06 – 07/07/2025 1. KHUYẾN MÃI X3\r\nAdmin sẽ mở khuyến mãi x3 giá trị thẻ nạp (Áp dụng cho mọi hình thức) và x3 Tiềm năng sức mạnh lúc 00:05 07/06 đến 23:55 08/06 2. ĐỔI QUÀ TẠI NPC QUY LÃO – ĐẢO KAME\r\n- Mỗi lần nạp ngọc, các cư dân sẽ có điểm tích lũy (1 ngọc = 1 điểm). Dùng điểm sự kiện để đổi vật phẩm tại NPC Quy Lão sẽ có cơ hội nhận vĩnh viễn\r\n- Tích điểm đến hết 17/06, sau đó chỉ dùng điểm dư để đổi vật phẩm 3. ĐUA TOP MỞ HỘP QUÀ THIẾU NHI 2025\r\n- Thời gian chi tiết: Xem tại NPC Chi Chi – Đảo Kame\r\n- Cần đủ 10 điểm sự kiện để vào bảng xếp hạng đua Top Phần thưởng:\r\n+ Top 1: Cadic Đi Biển (vĩnh viễn), Sách Cũ x70, Capsule Kích Hoạt x3, Con Dấu x2, Capsule Vỡ x1\r\n+ Top 2: Cadic Đi Biển (vĩnh viễn), Sách Cũ x60, Capsule Kích Hoạt x2, Con Dấu x1\r\n+ Top 3: Cadic Đi Biển (vĩnh viễn), Sách Cũ x50, Capsule Kích Hoạt x1\r\n+ Top 4–10: Cadic 180 ngày, Sách Cũ x20, Phiếu đổi Capsule x50\r\n+ Top 11–50: Cadic 60 ngày, Sách Cũ x10, Phiếu đổi Capsule x20\r\n+ Top 51–100: Cadic 30 ngày, Sách Cũ x5, Phiếu đổi Capsule x10\r\n4. MẶT TRỜI MÙA HÈ\r\n- Trong thời gian sự kiện sẽ xuất hiện Boss \"Mặt trời mùa hè\" ở tất cả các map\r\n- Boss có thể gây hiệu ứng Nóng làm giảm máu và sức đánh của người chơi\r\n- Cư dân có thể dùng Nước Mía để giải nhiệt\r\n- Khi hạ gục Boss sẽ có cơ hội nhận được Cờ Đeo Lưng Mặt Trời Mùa Hè hạn sử dụng 5. LÀM NƯỚC MÍA\r\n- Trong thời gian sự kiện sẽ xuất hiện Xe Nước Mía tại các làng của mỗi hành tinh\r\n- Các cư dân có thể thu thập nguyên liệu và làm theo công thức:\r\n2 Nước Đá + 5 Khúc Mía + 5 triệu vàng = 1 Ly Nước Mía\r\n- Khi hoàn thành công thức sẽ có thể ngẫu nhiên nhận được:\r\n+ Nước Mía Khổng Lồ (+10% HP)\r\n+ Nước Mía Thơm (+10% HP + 10% chí mạng)\r\n+ Nước Mía Sầu Riêng (+10% HP + 10% giáp + 10 sức đánh) - Nguyên liệu:\r\n+ Nước Đá: mua tại Chi Chi, đánh Boss Cooler hoặc quái map Cold\r\n+ Khúc Mía: rớt từ quái thường & phó bản cấp 20 trở lên\r\n- Đua Top làm Nước mía\r\nLưu ý: Cần đủ 10 điểm để vào bảng xếp hạng đua Top Phần thưởng:\r\n+ Top 1: Rada VIP 100, Đá Bảo vệ x60, Capsule Kích Hoạt x3, Capsule Vỡ x1\r\n+ Top 2: Rada VIP 50, Đá Bảo vệ x40, Capsule Kích Hoạt x2\r\n+ Top 3: Rada VIP 30, Đá Bảo vệ x30, Capsule Kích Hoạt x1\r\n+ Top 4–10: Rada VIP 20, Đá Bảo vệ x20, Phiếu đổi Capsule x50\r\n+ Top 11–50: Rada VIP 10, Đá Bảo vệ x10, Phiếu đổi Capsule x20\r\n+ Top 51–100: Rada VIP 5, Đá Bảo vệ x5, Phiếu đổi Capsule x10\r\n6. TOP ĂN KEM TRÁI CÂY\r\n- Người chơi có thể mua Kem trái cây tại NPC Chi Chi với 50 ngọc / 1 cây\r\n- 1 Kem trái cây = 1 điểm đua top\r\n- Khi sử dụng Kem trái cây sẽ nhận được Que kem, dùng Que kem để có thể nhận được các vật phẩm đặc biệt và có cơ hội trúng thưởng đổi được Cải Trang Buma mới Phần thưởng đua Top:\r\n+ Top 1: Rada VIP 100, Đá Bảo vệ x60, Capsule Kích Hoạt x3, Mảnh Khỉ x20, Capsule Vỡ x1\r\n+ Top 2: Rada VIP 50, Đá Bảo vệ x40, Capsule Kích Hoạt x2, Mảnh Khỉ x10\r\n+ Top 3: Rada VIP 30, Đá Bảo vệ x30, Capsule Kích Hoạt x1, Mảnh Khỉ x5\r\n+ Top 4–10: Rada VIP 20, Đá Bảo vệ x20, Phiếu đổi Capsule x50, Mảnh Khỉ x2\r\n+ Top 11–50: Rada VIP 10, Đá Bảo vệ x10, Phiếu đổi Capsule x20\r\n+ Top 51–100: Rada VIP 5, Đá Bảo vệ x5, Phiếu đổi Capsule x10\r\n7. THỨC ĂN CHO THẦN – TÍCH ĐIỂM ĐỔI QUÀ\r\n- Áp dụng cho người chơi sức mạnh từ 200 triệu trở lên\r\n- Mỗi loại thức ăn có giới hạn/ngày\r\n- Mỗi nhân vật tích có thể tích lũy tối đa 999 điểm/ngày\r\n+ Tayaki: Đánh quái, 99/ngày (Không ký gửi)\r\n+ Kẹo Táo: Nhiệm vụ siêu khó, 2/ngày (Không ký gửi)\r\n+ Kem Que Đôi: Quái map Cold, 50/ngày (Ký gửi vàng)\r\n+ Mochi: Boss Ăn Trộm, Ở Dơ, Virút, 7/ngày (Ký gửi ngọc)\r\n+ Râu Bạch Tuộc: Boss Bản Đồ Kho Báu cấp 20 trở lên, 5/ngày (Ký gửi vàng)\r\n+ Ramen: Boss Baby, Black Goku, Cooler, Cumber, 10/ngày (Ký gửi ngọc)\r\n- Sau khi thu thập đủ các loại thức ăn, đến NPC Thần Hủy Diệt đổi thức ăn để lấy \"Phiếu Thức Ăn\" - Dùng \"Phiếu Thức Ăn\" để đổi lấy các phần quà tại NPC Thần Hủy Diệt:\r\n+ Rada Ngọc Rồng : 199 phiếu\r\n+ Pet Baby Shark HSD hoặc vĩnh viễn: 1999 phiếu\r\n+ Rương Cải Trang Hải Tặc: 99 phiếu\r\n+ Cờ Ẩm Thực HSD hoặc vĩnh viễn: 999 phiếu + Hộp Đồ Thần Linh: 9999 phiếu (chỉ đổi 1 lần)\r\n8. VÒNG QUAY THƯỢNG ĐẾ\r\nCập nhật thêm các vật phẩm tại vòng quay sự kiện đặc biệt:\r\n+ Tanjiro\r\n+ Inosuke Hashibira\r\n+ Zenitsu\r\n+ Nezuko\r\n+ Gậy Phép Của Frieren\r\nCòn Tiếp Sự Kiện Hè 2!\r\nChúc các cư dân chơi game vui vẻ', 'admin', '2025-06-06 09:06:27', 0, 1, '[\"sukienhe.jpg\"]', 0, 0, 9999),
